  function allNewDice() {
    const numArr = [];
    for (let i = 0; i < 10; i++) {
      numArr.push(Math.floor(Math.random() * 6) + 1);
    }
    return numArr;
  }

  console.log(myDice);

  const displayDice = myDice.map((die) => {
    <Die value={die} />;
  });
  return (
    <main className='main'>
      <div className='dice'>{displayDice}</div>
    </main>
  );
}

export default App;
